import React from 'react';
import './VerticalMenu.css';

function VerticalMenu() {
  return (
    <nav>
      <ul>
        <li>
          <a href='#'>
            <image src="##"/>
            <span className="nav-item">Etisalat Egypt</span>
          </a>
        </li>
        <li><a href='#'>
          <i className="fas fa-home"></i>
          <span className='nav-item'>Home</span>
        </a></li>
        <li><a href='#'></a></li>
        <li><a href='#'></a></li>
        <li><a href='#'></a></li>
        <li><a href='#'></a></li>
      </ul>
    </nav>
  );
}

export default VerticalMenu;
